import Header from "../src/components/Header";
import Footer from "./components/Footer";
import Shop from "./components/Shop";
import { API_KEY } from "./config";
import "./App.css";
import { ContextProvider } from "./context";
function App() {
  return (
    <>
      <ContextProvider>
        <Header />
        <Shop />
        <Footer />
      </ContextProvider>
    </>
  );
}
export default App;
